import '../../styles/Header/Navbar.css'
import {Link} from 'react-router-dom'


function Navbar() {
	return (
        <nav id = 'navbar'>
            <Link className = 'nav-link' id='nav-link-acc' to="/">Accueil</Link>
            <Link className = 'nav-link' id='nav-link-apropos' to="/a-propos">A propos</Link>
        </nav>
    )
}

export default Navbar
